script: |
  super -f text -I q6713.spq | sort > q6713.out

inputs:
  - name: q6713.spq
    data: |
      SELECT ALL + + col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + col2 IN ( - col1, - col1 * + 57 + - + 40 + - 75, - CAST ( + col1 AS INTEGER ) + - - col1 + - 51, 35 );
  - name: tab0

outputs:
  - name: q6713.out
    data: |
      1
      21
      81
